import './Login.css';
// import Register from './Signup';

const LoginPage = () => {

  return (

    <div className="login-page">
      {/* logo */}
      <div>
        <img src='./Images/Login/group2.png' alt='logo-login' className='picture-login' />
      </div>

      <div className="form">
        {/* username */}
        <div className="form-group">
          <label htmlFor="username">Username</label>
          <input type="text" name="username" placeholder="username" />
        </div>

        {/* password */}
        <div className="form-group">
          <label htmlFor="password">Password</label>
          <input type="password" name="password" placeholder="password" />
        </div>
      </div>



      {/* button click login */}

      <button type="button" className="btn" style={{ color: 'white', paddingLeft: '6%' }}>
        Log In
      </button>
      <button type="button" className="btn" style={{ color: 'white', paddingLeft: '5.8%' }}>
        Sign Up
      </button>
    </div>

  )
}
export default LoginPage;
